import React, {Component} from "react";
import {
    withScriptjs,
    withGoogleMap,
    GoogleMap,
    Marker
} from "react-google-maps";
import {useDispatch, useSelector} from "react-redux";
import {getRouteProps} from "../redux/apiMobileV2/ApiMobileV2Action";
import {GoogleApiWrapper, InfoWindow, Map} from "google-maps-react";


function RouteProps() {

    const dispatch = useDispatch();
    const data = useSelector(state => state.apiMobileV2Reducer.routePropsData);
    const status = useSelector(state => state.apiMobileV2Reducer.routePropsStatus);
    React.useEffect(() => {
        dispatch(getRouteProps())
    }, []);
    console.log(data)
}

export class MapContainer extends Component {
    render() {
        return (
            <Map google={this.props.google} zoom={14}>

                <Marker onClick={this.onMarkerClick}
                        name={'Current location'} />

                <InfoWindow onClose={this.onInfoWindowClose}>
                    <div>
                        <h1>{this.state.selectedPlace.name}</h1>
                    </div>
                </InfoWindow>
            </Map>
        );
    }
}

export default GoogleApiWrapper({
    apiKey: ("AIzaSyDS4sGjQ5hi3IFNYa0dYGyuxmNZzPwv1jc")
    })(MapContainer);
